text:
{'text': 'Always a pleasure to buy stuff here. The shop is small but there are plenty of aquarium essentials like fish food, filters, anti-chlorine, liquid fertilisers, and fish of course.

Store also sells driftwood and plants, though the selection may be small.

Shop assistants and owners are always friendly and willing to help out.', 'languageCode': 'en'}

